import { FormControl, Grid, Paper } from '@mui/material';
import Box from '@mui/material/Box';

export const RegisterPage = () => {
    return (
        <>
            <Box
                sx={{

                    height: "100vh",
                    display: "flex",
                    flexDirection:"column",
                    justifyContent: "center",
                    alignItems: "center",
                }}
            >
                <Paper elevation={8}
                sx={{
                    height: "500px",
                    minWidth: "600px",
                }}
                >    
                <FormControl variant="standard" sx={{ width: 1, gap: 1 }}>
                    <Grid sm={4}>
                        hello
                    </Grid>

                    <Grid sm={4}>
                    Aaayush
                    </Grid>
                </FormControl>
                </Paper>
            </Box>
        </>
    )
};
